class PaymentAuthResponse {  PaymentAuthResponse({    this.profile,    this.token,  });  PaymentAuthResponse.fromJson(dynamic json) {    profile =        json['profile'] != null ? Profile.fromJson(json['profile']) : null;    token = json['token'];  }  Profile? profile;  String? token;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    if (profile != null) {      map['profile'] = profile?.toJson();    }    map['token'] = token;    return map;  }}class Profile {  Profile({    this.id,    this.user,    this.createdAt,    this.profileType,    this.phones,    this.companyEmails,    this.companyName,    this.country,    this.city,    this.salesOwner,  });  Profile.fromJson(dynamic json) {    id = json['id'];    user = json['user'] != null ? User.fromJson(json['user']) : null;    createdAt = json['created_at'];    profileType = json['profile_type'];    phones = json['phones'] != null ? json['phones'].cast<String>() : [];    companyEmails = json['company_emails'] != null        ? json['company_emails'].cast<String>()        : [];    companyName = json['company_name'];    country = json['country'];    city = json['city'];    salesOwner = json['sales_owner'];  }  int? id;  User? user;  String? createdAt;  String? profileType;  List<String>? phones;  List<String>? companyEmails;  String? companyName;  String? country;  String? city;  String? salesOwner;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['id'] = id;    if (user != null) {      map['user'] = user?.toJson();    }    map['created_at'] = createdAt;    map['profile_type'] = profileType;    map['phones'] = phones;    map['company_emails'] = companyEmails;    map['company_name'] = companyName;    map['country'] = country;    map['city'] = city;    map['sales_owner'] = salesOwner;    return map;  }}class User {  User({    this.id,    this.username,    this.firstName,    this.lastName,    this.dateJoined,    this.email,    this.userPermissions,  });  User.fromJson(dynamic json) {    id = json['id'];    username = json['username'];    firstName = json['first_name'];    lastName = json['last_name'];    dateJoined = json['date_joined'];    email = json['email'];    userPermissions = json['user_permissions'] != null        ? json['user_permissions'].cast<int>()        : [];  }  int? id;  String? username;  String? firstName;  String? lastName;  String? dateJoined;  String? email;  List<int>? userPermissions;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['id'] = id;    map['username'] = username;    map['first_name'] = firstName;    map['last_name'] = lastName;    map['date_joined'] = dateJoined;    map['email'] = email;    map['user_permissions'] = userPermissions;    return map;  }}